  \ with the bubbles. Each finalist would link to use infinitely long Bubble Cup stick\
  \ to pop some bubbles. The i-th finalist would like to place the stick in the direction\
  \ of vector (dxi, dyi), and plays the following game until K_i bubbles are popped.\
  \ The game starts with finalist placing the stick in the direction of vector (dx_i,\
  \ dy_i), and sweeping it from the infinity to the left until it hits some bubble,\
  \ which is immediately popped. It is guaranteed that only one bubble will be hit\
