  \ clockwise direction with the center of rotation in point where the previous bubble\
  \ was popped. When the next bubble is hit, it is immediately popped and becomes\
  \ the new center of rotation. The process continues until K_i bubbles have been\
  \ popped. It is guaranteed that the stick won't hit two bubbles simultaneously in\
  \ this process. \n\nFor each finalist find which bubble would be popped the last.\
  \ Note that each game starts with the configuration of all N bubbles, so the games\
