  \ \u2264 N)\n\nOutput\n\nFor each of the Q finalists, print the index of the bubble\
  \ which would be popped last, in the separate line. \n\nExamples\n\nInput\n\n\n\
  4\n0 0\n1 0\n0 1\n1 1\n2\n1 -1 3\n-1 1 4\n\n\nOutput\n\n\n4\n2\n\n\nInput\n\n\n\
  4\n1 1\n2 2\n7 1\n1 7\n3\n2 2 1\n1 -5 4\n-6 5 3\n\n\nOutput\n\n\n3\n2\n3\n\nNote\n\
  \nThere are two finalists willing to play with the bubbles. If the first finalist\
